'''Non-tradeable items''', in terms of the [[Grand Exchange]], are [[items]] that are [[tradeable]], but not on the Grand Exchange. These items must therefore be exchanged via the standard [[Trading#First trade window|trading interface]].

Because of this, it may be difficult to obtain significant quantities of these items. Although most non-tradeable items are [[quest]]-related items or otherwise low in value when sold to [[shop]]s, certain [[Account|players]] seek them for collecting purposes. An example of this is players collecting [[burnt food]].

Unique items, especially those no longer able to be obtained by the player themselves, are often more sought-after than non-tradeable items such as various stages of chargeable [[jewellery]].

==List of non-tradeable items==
Not directly listed:
*[[Basket]]s partially filled with fruit ([[Bananas|Bananas (2)]], [[Strawberries|Strawberries (4)]], etc.).
*[[Black mask]]s that have charges, and do not currently have the maximum amount of charges.
*Partially completed [[Cooking]] items ([[Part summer pie (watermelon)]], [[Uncooked pizza]], etc.).
*Partially eaten [[food]] ([[Cake|2/3 cake]], [[Admiral pie|Half an admiral pie]], etc.).
*[[Jewellery#Enchanted jewellery|Enchanted jewellery]] that has charges, and does not currently have its maximum amount of charges (with the exception of [[amulet of glory|amulet of glory (4)]] and [[amulet of glory (t)|amulet of glory (t) (4)]]).

